import React from "react";
import Header from "../../components/Header";
import UG from "../../assets/UG.jpg"

const Education = () => {
  return (
  	<div>
      <Header/> 
      <header className="py-5">
        <div class="d-flex justify-content-center align-items-center">
            <i class="fa fa-graduation-cap fa-4x"></i><h1 class="ms-3">My Education</h1>
        </div>
        <div className="py-4 container">
          <div class="ms-5 card">
            <div className="row">
              <div className="col-md-3">
                <img className="card-img-top" src={UG} alt=""/>
              </div>
              <div className="col-md-5">
                <h3>Gunadarma University</h3>
                <div>Bachelor of Informatics Engineering</div>
                <p className="text-muted">Sep 2017 - Aug 2021</p>
              </div>
            </div>
          </div>
        </div>
      </header>
	</div>
    );
  };

export default Education;
